import { FC } from "react";
import { CourseTagProps } from "./props";
import styled from "styled-components";

const TagComponent = styled.div`
  width: 100%;
  color: #39414b;
  height: 42px;
  padding: 12px;
  border-radius: 12px;
  display: flex;
  align-items: center;

  font-family: "Nunito";
  font-style: normal;
  font-weight: 800;
  font-size: 18px;
  line-height: 18px;

  letter-spacing: -0.1px;
`;

export const CourseTag: FC<CourseTagProps> = ({ name, isActive }) => {
  return <TagComponent>{name}</TagComponent>;
};
